import { fork, all } from 'redux-saga/effects';

import {
  watchLoginStarted,
  watchRefreshTokenStarted,
  watchSignupStarted,
  watchResetPassword,
} from './auth';

import {
  watchVersusFetch,
  watchVoteFetch,
} from './versus'

import {
  watchCommentFetch,
  watchCommentAddition,
} from './comments'


import {
  watchFetchHeart,
  watchFetchLIke,
  watchHeart,
  watchLike,
  watchUnHeart,
  watchUnLike
} from './reaction'

import {
  watchFollowUser,
  WatchfOLLOWExtraUser,
  watchFollowingExtraUserFetch,
  watchFollowingUserFetch,
  watchUnFollowExtraUser,
  watchUnFollowUser
} from './user'

import {
  watchHistoryHashtagFetch,
  watchHistoryUserFetch,
  watchHashgagFetch,
  watchUserFetch,
} from './search'


import {
  watchTopicFetch
} from './topic'


import {
  watchTopicSelected,
  watchUserPostFetch,
  watchPostFetch
} from './post'

import {
  watchSendReport
} from './report'

function* mainSaga() {
  yield all([
    fork(watchCommentAddition),
    fork(watchCommentFetch),
    fork(watchFetchHeart),
    fork(watchFetchLIke),
    fork(WatchfOLLOWExtraUser),
    fork(watchFollowingExtraUserFetch),
    fork(watchFollowingUserFetch),
    fork(watchFollowUser),
    fork(watchHashgagFetch),
    fork(watchHeart),
    fork(watchHistoryHashtagFetch),
    fork(watchHistoryUserFetch),
    fork(watchLike),
    fork(watchLoginStarted),
    fork(watchPostFetch),
    fork(watchRefreshTokenStarted),
    fork(watchResetPassword),
    fork(watchSendReport),
    fork(watchSignupStarted),
    fork(watchTopicFetch),
    fork(watchTopicSelected),
    fork(watchUnFollowExtraUser),
    fork(watchUnFollowUser),
    fork(watchUnHeart),
    fork(watchUnLike),
    fork(watchUserFetch),   
    fork(watchUserPostFetch),
    fork(watchVersusFetch),
    fork(watchVoteFetch),
  ]);
}


export default mainSaga;
